import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <input type="checkbox" name="check-1" id="check-1" >Item 1</input>
      </body>
    </div>
  );
}

export default App;
